import Error from "@/components/Error";
import LoaderMT from "@/components/LoaderMT";
import { useFetch } from "@/hooks/useFetch";
import React, { SetStateAction } from "react";
import { PYCCoinIcon } from "../tap/Click";
import DrawerModal from "@/components/modals/DrawerModal";
import { sendPostRequest } from "@/lib/sendRequest";
import { getTGID } from "@/lib/getTGID";
import toast from "react-hot-toast";
import { UserInfo } from "@/lib/ResponseTypes";
import PYCCoinsText from "@/components/PYCCoinsText";
import { useBlast } from "@/components/CoinBlast";

export type HourlyReward = {
  reward_id: number;
  coins_to_claim: number;
  increase_in_coins: number;
  reward_name: string;
};

type DailyComboProps = {
  userInfo: UserInfo;
  refetchUserInfo: () => void;
};
const DailyCombo = (props: DailyComboProps) => {
  const { isLoading: rewards_isLoading, data: rewardsData } = useFetch<
    HourlyReward[]
  >({ serverPath: "/api/v1/hourly-rewards" });
  const rewards = rewardsData?.data;

  if (rewards_isLoading) return <LoaderMT />;
  if (!rewards) return <Error />;
  return (
    <section className="mt-8">
      <h2 className="font-medium">Daily combo:</h2>
      <div className="mt-2 grid grid-cols-2 gap-x-2 gap-y-2">
        {rewards.map((reward) => {
          return (
            <ComboCard
              refetchUserInfo={props.refetchUserInfo}
              userInfo={props.userInfo}
              key={reward.reward_id}
              reward={reward}
            />
          );
        })}
      </div>
    </section>
  );
};

export default DailyCombo;

type ComboCardProps = {
  reward: HourlyReward;
  userInfo: UserInfo;
  refetchUserInfo: () => void;
};
const ComboCard = (props: ComboCardProps) => {
  const [showModal, setShowModal] = React.useState(false);
  return (
    <>
      <button
        disabled={
          props.userInfo.hourly_coins_pack_id === props.reward.reward_id
        }
        onClick={() => setShowModal(true)}
        className="bg-blue-l rounded-lg px-4 py-4 disabled:opacity-50"
      >
        <div className="flex items-center gap-x-2 px-1 pb-4 border-b border-[#5A4EFF]">
          <span>
            <RewardIcon name={props.reward.reward_name} />
          </span>
          <div className="text-left font-medium text-sm lt:text-base line-clamp-1">{props.reward.reward_name}</div>
        </div>
        <div className="mt-4 grid grid-cols-[1.5fr_1fr] w-full gap-x-2 gap-y-2">
          <div className="text-xs opacity-50 text-left">Profit per hour</div>
          <div className="text-xs opacity-50 text-left">Lvl 1</div>
          <div className="flex items-center gap-x-1 text-sm">
            <PYCCoinIcon className="opacity-40 w-4" />
            <span>+{props.reward.increase_in_coins}</span>
          </div>
          <div className="flex items-center gap-x-1 text-sm">
            <PYCCoinIcon className="w-3" />
            <span>{props.reward.coins_to_claim}</span>
          </div>
        </div>
      </button>
      <ComboCardModal
        reward={props.reward}
        open={showModal}
        setOpen={setShowModal}
        refetchUserInfo={props.refetchUserInfo}
      />
    </>
  );
};

type ComboCardModalProps = {
  reward: HourlyReward;
  open: boolean;
  setOpen: React.Dispatch<SetStateAction<boolean>>;
  refetchUserInfo: () => void;
};
const ComboCardModal = (props: ComboCardModalProps) => {
  const [submitting, setSubmitting] = React.useState(false);
  const {blast} = useBlast();
  const tg_id = getTGID();
  const activatePack = async () => {
    const response = await sendPostRequest(
      `/api/v1/activate-hourly-pack/${tg_id}`,
      { reward_id: props.reward.reward_id }
    );
    if (response.status) {
      blast();
      toast.dismiss();
      toast.success("Activated");
      props.refetchUserInfo();
      props.setOpen(false);
    } else {
      toast.dismiss();
      toast.error(response.message);
    }
  };
  const handleActivateClick = async () => {
    toast.loading("Activating...");
    setSubmitting(true);
    await activatePack();
  
    setSubmitting(false);
  };
  return (
    <DrawerModal open={props.open} setOpen={props.setOpen} modalWrapperClassName="min-h-fit">
      <div className="p-4 pb-8">
        <div className="bg-blue-p rounded-lg p-4">
          <div className="flex gap-x-2 items-center justify-center">
            <PYCCoinsText
              textClassName="text-3xl"
              imageClassName="w-12"
              tokens={props.reward.increase_in_coins}
            />{" "}
            <span className="text-3xl font-semibold">every hour</span>
          </div>
          <h3 className="text-center mt-2 font-medium text-xl">
          You need {props.reward.coins_to_claim} coins to activate this pack
        </h3>
        </div>

       
        <div className="justify-center flex mt-4">
          <button
            disabled={submitting}
            onClick={handleActivateClick}
            className="mx-auto bg-yellow-p w-full disabled:opacity-50 text-center rounded-lg px-4 py-4 text-xl text-blue-p font-semibold"
          >
            Activate
          </button>
        </div>
      </div>
    </DrawerModal>
  );
};

type RewardIconProps = {
  name: string;
};
const RewardIcon: React.FC<RewardIconProps> = (props: RewardIconProps) => {
  switch (props.name) {
    case "CEO":
      return <CEOIcon />;
    case "Marketing":
      return <MarketingIcon />;
    case "IT Team":
      return <ITTeamIcon />;
    case "Support Team":
      return <SupportTeamIcon />;
    case "PayTap Book":
      return <LockIcon />;
    case "PayTap Tube":
      return <LockIcon />;
    default:
      return null; // or a default icon
  }
};

